import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import "./App.css";
import CHAT from "./components/chat/CHAT";

function App() {
  return (
    <div className="App">
      <Router>
      <Routes>
        <Route path="/" element={CHAT}/>
      </Routes>
      </Router>
     </div>
  );
}

export default App;
